We also create two functions: `closeTooltip` and `openTooltipHandler`. The `closeTooltip` function sets the `openTooltip` state to `null`, which will close the currently open Tooltip. The `openTooltipHandler` function takes in an `id` parameter and updates the `openTooltip` state with that `id`. If the `openTooltip` state is already set to the `id` passed in, it will call the `closeTooltip` function to close the Tooltip.

